import React from "react";

function Icon(props){
 return  (
    <div 
      style = {{color: props.color, cursor: "pointer"}}>
        <i className ={props.typeIcon}>
         <span className="my-tooltip">
            <span className="my-tooltiptext">{props.toolTipText}</span>
         </span>
        </i>
    </div>);
};

export default Icon;
